<p>Flutter 是由 Google 开发的一个开源 UI 软件开发工具包，用于构建跨平台的应用程序。它允许开发者使用一套代码库即可为移动设备（iOS 和 Android）、桌面设备（Windows, macOS, Linux）以及 Web 创建高质量的原生界面。</p>
